import React from 'react';
import { ThemeProvider } from 'styled-components';
import {AppStyle, theme} from './styled/theme';


function App() {
	return (
		<ThemeProvider theme={theme}>
			<AppDiv>
        Hello World
			</AppDiv>
		</ThemeProvider>
	);
}

export default App;
